import React from "react";
import { Route, Routes } from "react-router-dom";
import  Search from "./Search";
import Menu from "./Menu"



const App = () => {
  return (
    <>
      <div>
        <h1>qqqqqqqqqqqqqqqqq</h1>
        <Routes>
          <Route path="/" element={<Menu/>}/>           
               <Route path="/search" element={<Search/>}>
          </Route> 
        </Routes>
      </div>
    </>
  );
};

export default App;
